import React from 'react';

function Movie({ movie, handleDelete }) {
  return (
    <li>
      {movie.title}
      {[...Array(movie.rating)].map((e, i) => <img key={i} src="/images/star.png" alt="Star" />)}
      <img 
        src="/images/delete.png" 
        alt="Delete movie" 
        className="delete-movie-icon" 
        onClick={() => handleDelete(movie.title)} 
      />
    </li>
  );
}

export default Movie;
